package com.Loops;

public class DisplayBet1To50Divi3and9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     for (int i=1; i<=50; i++)
     {
     {
    	 if ((i%3==0) && (i%9==0)){
    	 continue;
    	 }
    	 System.out.println(i);
     }
    
     }
	}

}
